# For agent only commands
class AgentCompleter(Completer):
    def __init__(self):
        self.pathCompleter = FuzzyCompleter(PathCompleter())

    def get_completions(self, document, complete_event):
        word = document.get_word_before_cursor()
        # shell, ls, pwd, cd, back
        options = [
            "upload",
            "back",
            "shell",
            "ls",
            "pwd",
            "help",
            "cd",
            "exit",
            "sleep",
        ]
        if document.text.startswith("upload "):
            subDoc = Document(document.text[7:])
            yield from (
                Completion(
                    completion.text,
                    completion.start_position,
                    display=completion.display,
                )
                for completion in self.pathCompleter.get_completions(
                    subDoc, complete_event
                )
            )
        else:
            options.sort()

            for option in options:
                if document.text.startswith(option):
                    return
            for option in options:
                # Stop completion if you are typing shell command
                yield Completion(option, start_position=-len(word))


