def gracefulExit(timer):
    try:
        print("Shutting down gracefully.")
        timer.cancel()
        if timer.is_alive():
            timer.join()
        agentsToDB()
        time.sleep(1)
        os._exit(0)
    except KeyboardInterrupt:
        pass


